import React, { useState } from "react";
import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import ExpensesFilter from "../ExpenseFilter/ExpensesFilter";
import "./Expenses.css";
function Expenses(props) {
  const [filteredYear, setfilteredYear] = useState("2020");
  const saveExpenseFilterDateHandler = (enteredExpensefilterDate) => {
    setfilteredYear(enteredExpensefilterDate);
    console.log(enteredExpensefilterDate);
  };
  return (
    <Card className="expenses">
      <ExpensesFilter onSaveExpenseFilterDate={saveExpenseFilterDateHandler} />
      <ExpenseItem
        title={props.expenses[0].title}
        amount={props.expenses[0].amount}
        date={props.expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.expenses[1].title}
        amount={props.expenses[1].amount}
        date={props.expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.expenses[2].title}
        amount={props.expenses[2].amount}
        date={props.expenses[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.expenses[3].title}
        amount={props.expenses[3].amount}
        date={props.expenses[3].date}
      ></ExpenseItem>
    </Card>
  );
}

export default Expenses;
